import React from "react";
function StickyBlockBox(props) {
  const { list } = props;
  return (
    <div>
      {list.map((item, index) => (
        <div className="item">
          {/* <ul> */}
          {item.type === "H1" && <span className="font-h1">{item.name}</span>}
          {item.type === "H2" && (
            <span className="font-h2">{`&nbsp;${item.name}`}</span>
          )}
          {/* </ul> */}
        </div>
      ))}
    </div>
  );
}
export default StickyBlockBox;
